import styled from "styled-components";
import StepCard from "./StepCard";

const Container = styled.div``;
const H1 = styled.h1``;

export default function Steps() {
  return (
    <>
      <H1>Como funciona?</H1>
      <Container>
        <StepCard></StepCard>
        <StepCard></StepCard>
        <StepCard></StepCard>
      </Container>
    </>
  );
}
